values:
So, I got my braces today. And they hurt like you-know-what. But I guess it'll be like that for awhile.

So. Life. Nothing new, nothing slightly exciting...I went off to the mall and ran around and bought stuff. I got a cookie...which I'm not supposed to eat in bed, because I will choke on it and die. XD

How's everyone's summer? I hope you all are good,&nbsp; I miss ya! We should all get together sometime. Come to the Y! Or something, idk. It's the only thing to do here in the summer. I'm excited! We're getting our pool put in finally, and I'm gonna have my birthday here I think! YAY! I need to get everyone's addresses and stuff 'cause I have NO ONES. Somehow I'll get them...sooo....yeah. HAVE A GOOD DAY!&nbsp;

&amp;hearts;

Ok, people have been talking about this alot. At this Anime North Connvention 2006 that ended not very long ago, there was a boy. Not just any boy, mind you- a boy dressed as Sora from Kingdom Hearts. On the side of the road. DIRTY DANCING. Now I'm forcing you to watch it.

http://www.youtube.com/watch?v=h-K3vGk6dJA

&hearts;

oh...man, you guys. i miss you all SO much already! i miss everything! i miss being crazy with everyone!&nbsp;&nbsp;

i hate to be acrimonious, but i guess we just have to move along. unfortunately, the world doesn't stop spinning and our lives keep going, no matter what happens.&nbsp;

BUT I MISS YOU ALL! i want to go back to those crazy times we had and we never thought they'd end! i hope to see you all a bunch over the summer and you all better be going to GRC! oooh yeah, we'll all be fresh meat together...&nbsp;

i love you all!

Well, I guess I'm suddenly in love with Wicked. Beth burned me a CD of the soundtrack. It's actually pretty good!

I'm getting ready to watch Rent- I'm excited! I can't wait 'till we get to sing it for Choir!


...anyway. &hearts;
